import React, { Component } from "react";

import arxiv from "arxiv";
import ArticleList from "./ArticleList.js";
import MainNav from "../Shared/MainNav.js";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      articles: []
    };
  }

  componentDidMount() {
    search_query = {
      title: "machinelearning"
    };

    arxiv.search(search_query, function(err, results) {
      console.log(
        "Found " + results.items.length + " results out of " + results.total
      );
      console.log(results.items.slice(0, 100));
    });
  }

  render() {
    return (
      <div>
        <MainNav />
      </div>
    );
    // return (
    //   <div className="container">
    //     <ArticleList articles={this.state.articles} />
    //   </div>
    // );
  }
}

export default Home;
